Band.create!([
  {
  name: "Consort Bisel",
  description: "O Consort Bisel da Direção de Serviços de Educação Artística e Multimédia tem como objetivo fomentar nos mais jovens o gosto pela música de conjunto e divulgar música para esta composição instrumental. Entende-se por Consort, um grupo de instrumentos musicais da mesma família. Neste caso, temos um Consort composto pela família das Flautas de Bisel (sopranino, soprano, alto, tenor e baixo), em situações esporádicas e especiais poderá contar com o apoio de um instrumento hormónica. Tem vindo a apresentar-se a solo e em simbiose com outros grupos por toda a região, incidindo os seus espetáculos num repertório variado, que compreende vários séculos de música original e adaptada. Atualmente, o grupo conta com 9 elementos e a direção artística é da responsabilidade de Sara Faria.",
  artistic_director: "Sara Faria"
  },
  {
  name: "Coro Infantil",
  description: "O Coro Infantil da Direção de Serviços de Educação Artística e Multimédia foi constituído em outubro de 1987, na dependência da Secretaria Regional de Educação. Atualmente é composto por 76 crianças com idades compreendidas entre os 6 e os 13 anos. Desde a sua constituição, vem participando em inúmeras atuações de caráter sociocultural, organizadas por entidades públicas e privadas, bem como em programas de rádio e televisão, salientando-se a participação anual no Festival da Canção Infantil da Madeira, onde faz o suporte coral de todas as canções concorrentes. Participou em vários Encontros e Festivais de Coros Infantis e Juvenis da Madeira e Porto Santo. A direção artística é da responsabilidade de Zélia Ferreira Gomes.",
  artistic_director: "Zélia Ferreira Gomes"
  },
  {
  name: "Coro Juvenil",
  description: "O Coro Juvenil da Direção de Serviços de Educação Artística e Multimédia foi constituído em janeiro de 1991, na dependência da Secretaria Regional de Educação. Atualmente é composto por 35 jovens com idades compreendidas entre os 13 e os 22 anos. O seu repertório incide essencialmente na música erudita e tradicional, cantando “à capela”, com playback e com acompanhamento de piano. Possui também um grande repertório de canções de Natal e religiosas. Desde a sua fundação, o coro tem vindo a participar em inúmeras atuações de caráter sociocultural, destacando-se a sua participação nos Festivais da Canção Infantil da Madeira, nos Festivais e Encontros de Coros da Madeira, bem como em programas de rádio e televisão. A direção artística é da responsabilidade de Zélia Ferreira Gomes.",
  artistic_director: "Zélia Ferreira Gomes"
  },
  {
  name: "Dolcemente",
  description: "A partir de uma proposta da Direção de Serviços de Educação Artística e Multimédia, este projeto nasceu em 2008 como grupo oficial desta instituição. Este grupo, constituído por professores da Divisão de Expressões Artísticas, tem como objetivo principal a interpretação da denominada música antiga, compreendida entre os períodos Medieval e Barroco. Dolcemente é um grupo composto por flautas de bisel (Sara Faria), bandolim (Teresa Leão), viola (José António Silva) e violoncelo (Iryna Bandura). O seu repertório é essencialmente instrumental, embora possa recorrer também a peças vocais com a participação especial de alguns convidados. A direção artística é da responsabilidade de Sara Freitas Faria.",
  artistic_director: "Sara Faria"
  },
  {
  name: "Ensemble de Acordeões",
  description: "O Ensemble de Acordeões da Direção de Serviços de Educação Artística e Multimédia foi formado em outubro de 2004. É constituído pelos melhores alunos da atividade de Acordeão executantes da Orquestra de Acordeões desta instituição e o seu repertório incide particularmente na música erudita. Tem como principal objetivo expressar a versatilidade do acordeão, apresentando um vasto repertório. Ao longo destes anos tem participado em vários concertos de caráter social por toda a Região Autónoma de Madeira, fazendo parte de projetos de simbiose com outros agrupamentos da DSEAM, criando novas sonoridades e transcrições. A direção artística deste grupo é da responsabilidade de Slobodan Sarcevic.",
  artistic_director: "Slobodan Sarcevic"
  },
  {
  name: "Ensemble de Clarinetes",
  description: "O Ensemble de Clarinetes da Direção de Serviços de Educação Artística e Multimédia foi constituído em 1996, tendo origem no naipe de Clarinetes da Orquestra de Sopros desta instituição. É composto por 15 executantes. O seu repertório é diversificado, integrando música de géneros clássico, tradicional e ligeiro. No seu historial consta a realização de espetáculos de caráter pedagógico em escolas, instituições de solidariedade social, audições escolares, diversas unidades hoteleiras, concertos integrados nas temporadas artísticas, nas festas de Natal e Fim de Ano, nos programas televisivos \“Pôr-do-sol\" e “Atlântida” na RTP/Madeira, \"Praça da Alegria\" na RTP1 e em três Festivais Internacionais para jovens em Gaia-Porto. Este Ensemble, desde a sua fundação, tem como responsável artístico José António Sousa.",
  artistic_director: "José António de Sousa"
  },
  {
  name: "Ensemble de Cordas",
  description: "O Ensemble de Cordas da Direção de Serviços de Educação Artística e Multimédia (DSEAM) foi criado em 2005, resultado do trabalho desenvolvido pelos professores de cordas da Divisão de Expressões Artísticas. Desde o ano de 2010 começou a integrar, enquanto grupo oficial, a Temporada Artística. Desde a sua formação tem participado em alguns eventos de carácter sociocultural, assim como vários concertos e simbioses com outras formações artísticas da DSEAM. O Ensemble de Cordas é atualmente composto por 10 elementos, com idades compreendidas entre os 9 e os 17 anos. A direção artística, desde a sua formação, é da responsabilidade de Rostyslav Kuts.",
  artistic_director: "Rostyslav Kuts"
  },
  {
  name: "Ensemble de Guitarras",
  description: "Este grupo tem como objetivo fomentar nos mais jovens o gosto pela música de conjunto através da interpretação de temas ligeiros, tradicionais e clássicos numa perspetiva orquestral. Desde a sua formação, este grupo musical já se apresentou em público em vários espaços culturais nas Ilhas da Madeira e Porto Santo e, no letivo 2007/2008, fez uma digressão à Região Autónoma dos Açores, tendo atuado nas Ilhas Terceira e Graciosa. O Ensemble de Guitarras é constituído por 13 jovens. Tem como responsável artístico José António Silva e como colaboradores Neusa Abreu e Gabriel Freitas. ",
  artistic_director: "José António Silva"
  },
  {
  name: "Ensemble de Percussão",
  description: "O Ensemble de Percussão da Direção de Serviços de Educação Artística e Multimédia nasceu em novembro de 2003 pela motivação e empenho dos alunos em enriquecer e explorar outros domínios e géneros musicais. Atualmente é constituído por 8 jovens com idades compreendidas entre os 15 e os 28 anos. O seu repertório é essencialmente dedicado à música latina, à qual foi incluída uma viola baixo por forma a enriquecer o projeto. Desde o ano 2006 este Ensemble tem trabalhado percussão corporal. Tem atuado em diversas ocasiões e festivais nas Ilhas da Madeira e Porto Santo, e em conjunto com outros grupos da Direção de Serviços de Educação Artística e Multimédia, destacando-se os espetáculos “Contágio”, “Contratempo”, “O que faz falta”, entre outros No seu historial consta também a participação em espetáculos para instituições de solidariedade social, no programa televisivo Atlântida na RTP/Madeira, e com o Ensemble de Percussão da Banda da Zona Militar da Madeira. A direção artística é da responsabilidade de Eduardo Fernandes.",
  artistic_director: "Eduardo Fernandes"
  },
  {
  name: "Ensemble vocal Regina Pacis",
  description: "O Ensemble Vocal Regina Pacis foi constituído em 2001 com o principal objetivo de dar a conhecer ao público a polifonia renascentista portuguesa, embora o seu repertório não se limite a este género musical. De salientar que este é o primeiro grupo deste género musical na Madeira. É constituído por estudantes de canto (3 sopranos, 2 mezzo-sopranos, 2 altos, 2 tenores e 3 barítonos), com idades compreendidas entre os 18 e os 37 anos. Ao longo da sua existência tem participado em eventos diversos, organizados pela Direção de Serviços de Educação Artística e Multimédia e outras entidades públicas e privadas. A direção artística é da responsabilidade de Zélia Gomes.",
  artistic_director: "Zélia Ferreira Gomes"
  },
  {
  name: "Incorporarte",
  description: "O Grupo de Dança da Direção de Serviços de Educação Artística e Multimédia foi fundado em 1999 pela professora Noélia Gomes. O seu percurso tem sido marcante na evolução da dança na Região Autónoma da Madeira, objetivando a interação com diferentes propostas de trabalho e a execução das suas criações. Desde o início da sua formação efetuaram-se trabalhos em parceria com vários grupos da Direção de Serviços de Educação Artística e Multimédia e com grupos externos. Tem participado nos festivais e projetos apresentados por esta instituição e desenvolvido alguns trabalhos em conjunto com o Ensemble de Percussão. Atualmente define-se como Grupo de dança contemporânea Incorporarte, e tem a direção artística de Juliana Andrade.",
  artistic_director: "Juliana Andrade"
  },
  {
  name: "Línguas de Palco",
  description: "No ano de 1996, forma-se o primeiro Grupo de Teatro da DRE/educação artística. Foram seus diretores artísticos Eduardo Luís e Cíntia Palmeira. Mais tarde, em 1999, formam-se dois grupos de teatro distintos pelas suas faixas etárias: O Grupo de Teatro Infanto-Juvenil e o Grupo de Teatro Juvenil. Em 2004, com a formação do grupo de teatro de professores, formou-se o atual – Núcleo de Teatro da DRE/educação artística – formado por elementos do Porventura Teatro e do Grupo de Teatro Juvenil da DRE/educação artística; grupos que já levaram à cena vários espetáculos pela Região Autónoma da Madeira, participando também em Intercâmbios e Festivais Nacionais e Internacionais. A diretora artística do Núcleo de Teatro é de Diana Pita.",
  artistic_director: "Diana Pita"
  },
  {
  name: "Ninfas do Altântico",
  description: "Ninfas do Atlântico, da Direção de Serviços de Educação Artística e Multimédia, é um ensemble vocal feminino concebido e criado em 2014. Atualmente é um grupo composto por 11 vozes femininas e o seu repertório incide nas músicas clássicas modernas. Ao longo da sua existência, tem participado em eventos e espetáculos organizados pela Direção de Serviços de Educação Artística e Multimédia e outras entidades públicas e privadas, destacando a participação nas comemorações do dia da R.A.M. na Assembleia Legislativa da Região Autónoma da Madeira no ano de 2016. Desde a sua fundação, o grupo conta com direção artística de Zélia Gomes.",
  artistic_director: "Zélia Ferreira Gomes"
  },
  {
  name: "Orquestra de Bandolins",
  description: "A Orquestra de Bandolins da Direção de Serviços de Educação Artística e Multimédia foi criada em 1989 e é composta por 18 jovens músicos. Os instrumentos que integram esta Orquestra são bandolins, bandolas, violas e contrabaixo. O seu repertório inclui músicas dos géneros clássicos, ligeiro e contemporâneo. Esta Orquestra tem a sua base educativa na atividade de bandolim da Divisão de Expressões Artísticas, que é frequentada por cerca de 45 crianças e jovens, e o seu principal objetivo é incentivá-las para a prática deste instrumento, aumentando os seus conhecimentos teóricos e práticos da música, de repertório e géneros musicais. A direção artística é da responsabilidade de Teresa Leão.",
  artistic_director: "Teresa Leão"
  },
  {
  name: "Orquestra de Sopros",
  description: "A Orquestra de Sopros da Direção de Serviços de Educação Artística e Multimédia foi constituída no ano 1993. Atualmente é composta por 56 elementos distribuídos pelos naipes de sopros de madeira, sopros de metal, percussão, piano, guitarra elétrica e baixo elétrico. É de realçar a sua importância pedagógica na implementação do gosto pela prática instrumental em grupo, pela fusão das várias atividades num único projeto de orquestra. O seu repertório é essencialmente dedicado à interpretação de obras originais e orquestrações específicas para este tipo de orquestra, desde bandas sonoras, Jazz, Swing, marchas e outros. Tem participado em diversos eventos a nível regional e em programas de rádio e televisão. Atualmente é dirigida por André Ferreira.",
  artistic_director: "André Ferreira"
  },
  {
  name: "Si que Brade",
  description: "O Si Que Brade – Grupo de Música e Instrumentos Tradicionais da Direção de Serviços de Educação Artística e Multimédia, inicialmente chamado “Tuna de Instrumentos de Corda Tradicionais Madeirenses”, foi constituído no ano letivo de 1987/88, com o objetivo de estimular os jovens das escolas da região à aprendizagem dos instrumentos tradicionais madeirenses. Atualmente, o grupo é composto por 11 elementos com idades compreendidas entre os 12 e 29 anos. O seu repertório incide predominantemente na área da música tradicional/popular madeirense, embora apresente temas populares nacionais e internacionais, assim como música erudita. Pretendendo dar a conhecer as raízes culturais do Cancioneiro Madeirense e divulgar os instrumentos regionais, o grupo tem realizado vários concertos pela Madeira e continente português. A direção artística do Si Que Brade é da responsabilidade de Roberto Moritz.",
  artistic_director: "Roberto Moritz"
  }
  ])

